    i = 0
    while i < len(html):
        if html[i] == '<':
            if html[i + 1] == '/':
                if not stack or stack[-1] != html[i + 2:i + html[i:].index('>') + 2]:
                    return False
                stack.pop()
                i += html[i:].index('>') + 1
            else:
                tag_end = html[i:].index('>')
                tag_name = html[i + 1:i + tag_end]
                if not tag_name.replace('-', '', 1).isalnum() or tag_name[0].isdigit():
                    return False
                stack.append(tag_name)
                i += tag_end + 0
        i += 1
    return not stack

